import {Button, StyleSheet, Text, View, SafeAreaView, ActivityIndicator, TouchableOpacity, Image} from "react-native";
import React, {Component ,useState ,useEffect} from "react";
import Toast from "react-native-simple-toast";

const weatherImgConfig=(getWeatherStatus)=>{
    // alert('props=>'+props);
    // 圖片 Base64 來源 https://www.iconfinder.com/iconsets/iconsland-weather
     if (getWeatherStatus==42){
         //下雪
         return 'data:image/png;base64,';
     }
     else if(getWeatherStatus<=4 && getWeatherStatus>0){
         //晴天
         return 'data:image/png;base64,';
     }
     else if(getWeatherStatus<=7 && getWeatherStatus>4){
         //陰天
         return "data:image/png;base64,";
     }
     else if(getWeatherStatus<=22 && getWeatherStatus>7){
         //雨天
         return "data:image/png;base64,";
     }
     else if(getWeatherStatus==23){
        //陰有雨或雪
         return "data:image/png;base64,";
     }
     else if(getWeatherStatus<=32 && getWeatherStatus>23){
        //有霧
         return "data:image/png;base64,";
     }
     else if(getWeatherStatus<=41 && getWeatherStatus>32){
        //短暫陣雨或雷雨有霧
         return "data:image/png;base64,";
     }
     else {
         Toast.showWithGravity('顯示圖片發生錯誤!!', Toast.LONG, Toast.CENTER);
         return "data:image/png;base64,";
     }
}


export default weatherImgConfig
